string b = " !#$%&'()*+,-./0123456789:;<=>@ABCDEFGHIJKLMNOPQRSTUVWXYZ[]^_`abcdefghijklmnopqrstuvwxyz{|}~";

int MOD;

void ammend(vector<int>& f, const vector<int>& g, const vector<int>& h, const vector<vector<int>>& choose) {
	for (int i = 0; i < g.size(); ++i) {
		for (int j = 0; j < h.size(); ++j) {
			f[i + j + 1] = (f[i + j + 1] + (long long)g[i] * h[j] % MOD * choose[i + j][j]) % MOD;
		}
	}
}

void one_case_small(int n) {
	cin >> MOD;
	vector<vector<int>> choose(n + 1, vector<int>(n + 1));
	for (int i = 0; i <= n; ++i) {
		for (int j = 0; j <= i; ++j) {
			choose[i][j] = ((j == 0 || j == i) ? 1 : (choose[i - 1][j - 1] + choose[i - 1][j]) % MOD);
		}
	}
	vector<vector<int>> f0(n + 1);
	vector<vector<int>> f1(n + 1);
	vector<vector<int>> f2(n + 1);
	for (int i = 0; i <= n; ++i) {
		f0[i] = vector<int>(i + 1);
		f1[i] = vector<int>(i + 1);
		f2[i] = vector<int>(i + 1);
	}
	f0[0][0] = 1;
	f1[0][0] = 1;
	f2[0][0] = 1;
	f0[1][1] = 1;
	f1[1][1] = 1;
	f2[1][0] = 1;
	for (int i = 2; i <= n; ++i) {
		for (int j = 0; j < i; ++j) {
			ammend(f0[i], f1[j], f1[i - j - 1], choose);
			ammend(f1[i], f1[j], f2[i - j - 1], choose);
			ammend(f2[i], f2[j], f2[i - j - 1], choose);
		}
	}
	int result = 0;
	for (int i = 0; i <= n; ++i) {
		result = (result + f0[n][i]) % MOD;
	}
	printf("%d\n", result);
}

void one_case(int n) {
	if (n <= 100) {
		one_case_small(n);
		return;
	}
	int m;
	cin >> m;
	long long ret = 0;
	for (char c : a[n - 3 - 100]) {
		ret = (ret * b.size() + b.find(c)) % m;
	}
	printf("%d\n", (int)(ret % m));
}

int main()
{
#ifdef _MSC_VER
	freopen("e.in", "r", stdin);
#endif
	std::ios::sync_with_stdio(false);
	int n;
	while (cin >> n) {
		one_case(n);
	}
	return 0;
}